package com.daengdaeng.domain.pet.domain;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.EnumType;import javax.persistence.Enumerated;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import lombok.AccessLevel;import lombok.Getter;import lombok.NoArgsConstructor;@NoArgsConstructor(access = AccessLevel.PROTECTED)@Getter@Entitypublic class Mbti {	public enum MbtiType{		EWOS, EWON, EWHS, EWHN, EDOS, EDON, EDHS, EDHN,		IWOS, IWON, IWHS, IWHN,	IDOS, IDON, IDHS, IDHN	}	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	private int mbtiId;	@Enumerated(EnumType.STRING)	@Column(nullable = false)	private MbtiType mbti;}